VALUES ('8410076473011', 'Kit pour Poulet Tikka Masala', 'Riz basmati aux épices (240g) : riz Basmati (94.5%), herbes et épices (1.9%) (graines de _moutarde_, curcuma, graines de cumin, graines de fenouil, feuilles de fenugrec déshydratées), sel, lentilles, huile de tournesol. Chutney à la mangue (100g) : mangues (46%), sucre, oignons, vinaigre de vin blanc, graines de _moutarde_, graines de fenugrec, sel, mélange aux épices (coriandre, curmin, curcuma, piment de cayenne, sel, fenouil, feuilles de laurier, fenugrec, ail, cannelle, clou de girofle), graines d\'oignons, noix de muscade, clou de girofle. Mélange aux épices (80g) : oignons déshydratés, huile de tournesol (contient antioxydant : E320), herbes (11%) (feuilles de coriandre, feuille de laurier, feuille de fenugrec déshydratée), gingembre, ail, épices (6%) (poudre de piment rouge, graine de coriandre, graine de fenouil, curcuma, cardamome, cannelle, cumin, gingembre, clou de girofle (0.14%), noix de muscade), sel, piment vert, tomates en poudre, sucre, maltodextrine, colorant : extrait de paprika, régulateurs d\'acidité : acide acétique, acide citrique.', 'https://static.openfoodfacts.org/images/products/841/007/647/3011/front_fr.9.400.jpg', '6.1', '0.7', '56.2', '11.1', '5.1', '6.2', '2.51', '0.988188976377953', '', '0');

