VALUES ('8410076474063', 'Kit pour Enchiladas au Four', 'Tortillas au maïs et au blé (51 %) : farine de maïs (36 %), farine de _blé_ (29 %), eau, stabilisant : glycérol; _gluten de blé_, huile de tournesol, dextrose, poudres à lever : diphosphates, carbonate acide de sodium; émulsifiant: mono- et diglycérides d\'acides gras; sel, correcteur d\'acidité: acide citrique. Conditionnées sous atmosphère protectrice. Sauce à cuisiner (46 %): eau, concentré de tomate (49 %), correcteur d\'acidité: acide citrique. Mélange aux épices pour Enchilada (3 %): chapelure (farine de _blé_, eau, levure), épices (25 %) (piment chili, paprika, piment de Cayenne, cumin, poivre noir), sel, farine de _blé_, légumes déshydratés (oignon, ail), dextrose, sucre de canne, extrait d\'épice (paprika), origan.', 'https://static.openfoodfacts.org/images/products/841/007/647/4063/front_fr.4.400.jpg', '2.9', '0.4', '31.8', '5.5', '', '5.6', '1.02', '0.401574803149606', '', '0');

