INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8410076480941', 'Kit pour burritos original', 'Galettes de blé souples nature (326 g) : farine de _blé_, eau, stabilisant : glycérol, huiles végétales (palme et colza) en proportion variable, émulsifiant : mono- et diglycérides d\'acides gras, dextrose, poudres à lever : carbonate acide de sodium, diphosphate disodique, sel. Sauce Original salsa (144 g) : tomates (61 %), oignons (16 %), poivrons verts (10 %), concentré de tomate, sel, vinaigre, copeaux d\'oignons déshydratés, sucre, oignon en poudre, jus de citron concentré, piment Guajillo (0,4 %), ail en poudre, épices, correcteur d\'acidité : acide citrique. Mélange aux épices pour Burritos (40 g) : haricots rouges en poudre, légumes déshydratés (oignon, poivron, ail), amidon de pomme de terre, épices (11,6 %) (piment chili, paprika, cumin, poivre noir), sel, sirop de glucose déshydraté, extrait de levure, arôme, sucre, correcteur d\'acidité : acide citrique, colorant : betterave rouge, extrait d\'épice (paprika), origan. Mélange aux épices pour Guacamole (10 g) : légumes déshydratés (oignon, poivron, ail), sirop de glucose déshydraté, sel, dextrose, épices (9 %) (cumin, piment de Cayenne, coriandre, paprika, poivre noir, gingembre), extrait de levure, correcteur d\'acidité : acide citrique, herbes (origan, persil), extrait d\'épice (poivre).', 'https://static.openfoodfacts.org/images/products/841/007/648/0941/front_fr.6.400.jpg', '3.8', '1.3', '40.4', '3.6', '2.3', '6.7', '1.83', '0.720472440944882', '', '0');

