VALUES ('8410076481016', 'Kit pour Poêlée Yucatan', 'Riz précuit finement épicé (200 g) : riz blanc loin grain précuit, maltodextrine, poudre de tomates, sel, sucre, huile de tournesol, extrait de paprika (0,1%), persil, correcteur d\'acidité : acide citrique. Sauce citron vert (150 g) : eau, _crème_, épinards, sel, amidon modifié de maïs, arômes, arôme coriandre, spécialité _fromagère_, stabilisant : gomme xanthane, correcteur d\'acidité : acide lactique, jus de citron vert concentré (0,13%). Mélange aux épices pour poêlée Yucatan (5 g) : maltodextrine, _lait_ en poudre, sel, sucre, herbes (origan, persil, thym), épices (2,5%), correcteurs d\'acidité : acide citrique, acide lactique; extrait de paprika. Mélange d\'épices pour Guacamole (20 g) : légumes déshydratés (oignon, poivre, ail), sirop de glucose déshydraté, sel, dextrose, épices (9%) (cumin, piment de Cayenne, coriandre, paprika, poivre noir, gingembre), extrait de levure, correcteur d\'acidité : acide citrique, herbes (origan, persil), extrait d\'épice (poivre).', 'https://static.openfoodfacts.org/images/products/841/007/648/1016/front_fr.7.400.jpg', '4.8', '2.6', '40.9', '1.2', '1.7', '4.4', '2.6', '1.02362204724409', '', '0');

